import React from 'react';

function FormComponent({ inputText, handleInputChange, handleFormSubmit }) {
  return (
    <form onSubmit={handleFormSubmit}>
      <label>
        Add New Task:
        <input
          type="text"
          value={inputText}
          onChange={handleInputChange}
        />
      </label>
    </form>
  );
}

export default FormComponent;
